import React from "react";
import { Routes, Route, Redirect, Switch } from "react-router-dom";
import Home from "../components/Home.Component";
import EnterMail from "../containers/account/EnterMail.Container";
import EnterOtp from "../containers/account/EnterOtp.Container";
import LogUp from "../containers/account/LogUp.Container";
export default function AppRouter() {
  return (
    <Routes>
      <Switch>

      <Route path="/" element={<Home />} />
      <Route
        path="/enterOtp"
        render={() => {
          return localStorage.getItem("sendOtp") ? <EnterMail /> : <Redirect to="/enterMail" />;
        }}
      />
      <Route path="/enterMail" element={<EnterMail />} />
      <Route path="/logUp" element={<LogUp />} />
      </Switch>
      {/* <Route path="teams" element={<Teams />}>
          <Route path=":teamId" element={<Team />} />
          <Route path="new" element={<NewTeamForm />} />
          <Route index element={<LeagueStandings />} />
        </Route> */}
    </Routes>
  );
}
